import React from 'react';

// Import photos for the team gallery. If you add or remove photos, update this list accordingly.
import foto1 from '../assets/fotos/team1.jpg';
import foto2 from '../assets/fotos/team2.jpg';
import foto3 from '../assets/fotos/team3.jpg';
import foto4 from '../assets/fotos/team4.jpg';
import foto5 from '../assets/fotos/team5.jpg';
import foto6 from '../assets/fotos/team6.jpg';
import foto7 from '../assets/fotos/team7.jpg';
import foto8 from '../assets/fotos/team8.jpg';

// Placeholder names. Update with real names if desired.
const names = [
  'Membro 1',
  'Membro 2',
  'Membro 3',
  'Membro 4',
  'Membro 5',
  'Membro 6',
  'Membro 7',
  'Membro 8',
];

const photos = [foto1, foto2, foto3, foto4, foto5, foto6, foto7, foto8];

const EquipePage = () => {
  return (
    <section className="section team-section">
      <h2 className="section-title">Nossa Equipe</h2>
      <div className="team-grid">
        {photos.map((photo, index) => (
          <div className="team-card" key={index}>
            <img src={photo} alt={names[index]} className="avatar-img" />
            <h3>{names[index]}</h3>
          </div>
        ))}
      </div>
      <p className="team-note">
        Conheça os membros que fazem parte da Mack Racing. Trabalhamos juntos em diversas áreas da engenharia para
        construir nosso carro de competição.
      </p>
    </section>
  );
};

export default EquipePage;
